import axios from 'axios'
import React, { useState, useEffect } from 'react'

const Sandbox = () => {
  const [Skyline, setSkyline] = useState()
  const [Loading, setLoading] = useState(false)
  const [HasError, setHasError] = useState(false)

  useEffect(() => {
    getSkyline()
  }, [])

  const getSkyline = async () => {
    try {
      setLoading(true)

      const { data: skyline } = await axios.post(
        `${process.env.REACT_APP_SKYLINE_API}/get-skyline`,
        data
      )

      setSkyline(skyline)
      setLoading(false)
    } catch (e) {
      // Error handling
      setLoading(false)
      setHasError(true)
      console.error('Server Error')
    }
  }

  return (
    <>
      <h1>Sandbox</h1>
      {HasError && <span style={{ color: 'red' }}>Server Error</span>}
      {Loading && <span>Loading ...</span>}
      {Skyline && <img src={Skyline} alt='' />}
    </>
  )
}

const data = {
  image:
    'data:image/jpeg;base64,',
  mask:
    'data:image/png;base64,',
}

export default Sandbox
